import React from 'react'
import PropTypes from 'prop-types'

function TickerApp(props) {

    const tickerList = ['a','b', 'c', 'd']

    const simpleList = () => (
        <ul>
          {tickerList.map(ticker => {
            return <li key={ticker}>{ticker}</li>;
          })}
        </ul>
    );
}

TickerApp.propTypes = {

}

export default TickerApp
